  <Menu inverted>
    <Menu.Item>
      <NavLink exact to="/">
        Home
      </NavLink>
    </Menu.Item>
    <Menu.Item>
      <NavLink exact to="/blogs">
        Blogs
      </NavLink>
    </Menu.Item>
  </Menu>
);

export default NavBar;
